    def __init__(self, data=None):
        self.head = None
        self.tail = None
        if data is not None:
            for item in data:
                self.append(item)

    def append(self, data):
        node = Node(data)
        if self.head is None:
            self.head = node
            self.tail = node
        else:
            node.prev = self.tail
            self.tail.next = node
            self.tail = node

    def reverse(self):
        current = self.tail
        reversed_list = []
        while current:
            reversed_list.append(current.data)
            current = current.prev
        return reversed_list

