['class Node:

    def __init__(self, value):
        self.value = value
        self.prev = None
        self.next = None

class LinkedList:

    def __init__(self):
        self.head = None
        self.tail = None

    def insert(self, value):
        node = Node(value)
        if self.head is None:
            self.head = node
            self.tail = node
        else:
            node.prev = self.tail
            self.tail.next = node
            self.tail = node

    def iterate_backward(self):
        node = self.tail
        while node is not None:
            yield node.value
            node = node.prev

def funcImp(arg1):
    ll = LinkedList()
    for value in arg1:
        ll.insert(value)
    return list(ll.iterate_backward())']

