['class Node:

    def __init__(self, data=None, prev=None, next_node=None):
        self.data = data
        self.prev = prev
        self.next = next_node

class DoublyLinkedList:

    def __init__(self, lst):
        self.head = Node(lst[0])
        self.tail = self.head
